FROM molecule m
WHERE m.molecule_id IN (
    SELECT DISTINCT a.molecule_id FROM atom a WHERE a.element = 'h'
)
AND m.molecule_id IN (
    SELECT DISTINCT b.molecule_id FROM bond b WHERE b.bond_type = '#'
);

